[Form]
public class CustTableLookup extends FormRun
{
    private FormControl callingControl;

}

void init()
{
    super();

    element.selectMode(custTable_AccountNum);

    var args = element.args();
    if (args.parmEnumType() == enumNum(CustTableLookupDisplayType) && args.parmEnum() == CustTableLookupDisplayType::MultilineAddress)
    {
        // show the MCR address display instead of the default
        MCRAddressGroup.visible(true);
        AddressGroup.visible(false);
    }
    callingControl = SysTableLookup::getCallerControl(args);
}

public void run()
{
    if (callingControl is FormStringControl)
    {
        var formStringControl = callingControl as FormStringControl;
        var isFiltered = SysTableLookup::filterLookupPreRun(formStringControl, custTable_AccountNum, custTable_ds);

        super();

        SysTableLookup::filterLookupPostRunEx(isFiltered, formStringControl.text(), custTable_AccountNum, custTable_ds,
                CustomerDataInteractorFactory::useExistingOrCreateResolver(formStringControl), dirPartyTable_Name, true);
    }
    else if (callingControl is SegmentedEntryControl)
    {
        var segmentedEntryControl = callingControl as SegmentedEntryControl;
        var isFiltered = SegmentedEntryTableLookup::filterSegmentedLookupPreRun(segmentedEntryControl,
                custTable_AccountNum, custTable_ds);

        super();

        SysTableLookup::filterLookupPostRunEx(isFiltered, segmentedEntryControl.currentSegmentText(),
                custTable_AccountNum, custTable_ds,
                CustomerDataInteractorFactory::useExistingOrCreateResolver(segmentedEntryControl), dirPartyTable_Name, true);
    }
    else
    {
        throw error(Error::wrongUseOfFunction(funcname()));
    }
}

/// <summary>
///  Override this method to support custom server form call backs
///  in the SegmentedEntryControl.
/// </summary>
/// <param name = "_selectedRecord">The record selected in the lookup.</param>
public void closeSelectRecord(Common _selectedRecord)
{
    var segmentedEntryControl = callingControl as SegmentedEntryControl;
    if (segmentedEntryControl)
    {
        var custTableLocal = _selectedRecord as CustTable;
        segmentedEntryControl.updateCustomLookupNaturalKey(custTableLocal.AccountNum);
        this.close();
    }
    else
    {
        super(_selectedRecord);
    }
}

public void init()
{
    super();

    this.queryBuildDataSource().clearDynalinks();
    this.queryBuildDataSource().clearLinks();
    this.queryBuildDataSource().addLink(fieldNum(DirPartyTable, PrimaryAddressLocation),
            fieldNum(LogisticsPostalAddress, Location));
}
